const JiraniData = {
    init: function () {
        if (!localStorage.getItem('jirani_initialized_v2')) {
            console.log('Initializing data from export...');
            if (typeof savedExportData !== 'undefined') {
                if (savedExportData.airbnbs) this.saveAirbnbs(savedExportData.airbnbs);
                if (savedExportData.properties) this.saveProperties(savedExportData.properties);
                localStorage.setItem('jirani_initialized_v2', 'true');
            }
        }
    },
    getAirbnbs: function () {
        const data = localStorage.getItem('jirani_airbnbs');
        if (data) return JSON.parse(data);
        return (typeof savedExportData !== 'undefined' && savedExportData.airbnbs) ? savedExportData.airbnbs : [];
    },
    getProperties: function () {
        const data = localStorage.getItem('jirani_properties');
        if (data) return JSON.parse(data);
        return (typeof savedExportData !== 'undefined' && savedExportData.properties) ? savedExportData.properties : [];
    },
    saveAirbnbs: function (data) {
        try {
            localStorage.setItem('jirani_airbnbs', JSON.stringify(data));
            return true;
        } catch (e) {
            console.error("Storage limit exceeded", e);
            alert("Storage limit exceeded! Remove high-res photos.");
            return false;
        }
    },
    saveProperties: function (data) {
        try {
            localStorage.setItem('jirani_properties', JSON.stringify(data));
            return true;
        } catch (e) {
            console.error("Storage limit exceeded", e);
            alert("Storage limit exceeded! Remove high-res photos.");
            return false;
        }
    },
    addAirbnb: function (item) {
        const items = this.getAirbnbs();
        item.id = Date.now().toString();
        items.push(item);
        return this.saveAirbnbs(items);
    },
    updateAirbnb: function (updatedItem) {
        const items = this.getAirbnbs();
        const index = items.findIndex(i => i.id == updatedItem.id);
        if (index > -1) {
            items[index] = updatedItem;
            return this.saveAirbnbs(items);
        }
        return false;
    },
    deleteAirbnb: function (id) {
        const items = this.getAirbnbs().filter(i => i.id != id);
        return this.saveAirbnbs(items);
    },
    addProperty: function (item) {
        const items = this.getProperties();
        item.id = Date.now().toString();
        items.push(item);
        return this.saveProperties(items);
    },
    updateProperty: function (updatedItem) {
        const items = this.getProperties();
        const index = items.findIndex(i => i.id == updatedItem.id);
        if (index > -1) {
            items[index] = updatedItem;
            return this.saveProperties(items);
        }
        return false;
    },
    deleteProperty: function (id) {
        const items = this.getProperties().filter(i => i.id != id);
        return this.saveProperties(items);
    },
    moveItem: function (type, id, direction) {
        const isAirbnb = type === 'airbnb';
        const items = isAirbnb ? this.getAirbnbs() : this.getProperties();
        const index = items.findIndex(i => i.id == id);
        if (index < 0) return false;

        const newIndex = index + direction;
        if (newIndex >= 0 && newIndex < items.length) {
            const temp = items[index];
            items[index] = items[newIndex];
            items[newIndex] = temp;
            return isAirbnb ? this.saveAirbnbs(items) : this.saveProperties(items);
        }
        return false;
    },
    getExportData: function () {
        const data = {
            airbnbs: this.getAirbnbs(),
            properties: this.getProperties()
        };
        return JSON.stringify(data, null, 4);
    }
};

JiraniData.init();
